import React,{useEffect, useState} from 'react';

const PersonCard = props => {
    const [res,setRes]=useState({})
    useEffect(()=>{
    fetch("https://pokeapi.co/api/v2/pokemon")
          .then(response => {
            return response.json();
        }).then(response => {
            setRes(response)
            console.log(response.results);
        }).catch(err=>{
            console.log(err);
        });
    },[]);
    return(
        <div>
        {res.results}
        </div>
    );
}

export default PersonCard;
